import React, { useState, useEffect } from "react";
import { useDrag } from "react-dnd";
import { styled } from "@mui/material/styles";
import Avatar from "@mui/material/Avatar";

import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import CardActions from "@mui/material/CardActions";
import Collapse from "@mui/material/Collapse";
import IconButton from "@mui/material/IconButton";
import Typography from "@mui/material/Typography";
import { yellow } from "@mui/material/colors";

function Employee({ employee: employee }) {
  const [{ isDragging }, drag] = useDrag(() => ({
    type: "employee",
    item: { id: employee.id, Name: employee.Name },
    collect: (monitor) => ({
      isDragging: !!monitor.isDragging(),
    }),
  }));
  return (
    <Card sx={{ maxWidth: 200 }} ref={drag} key={employee.id}>
      <CardHeader
        avatar={
          <Avatar sx={{ bgcolor: yellow[500] }} aria-label="recipe">
            {employee.Name[0]}
          </Avatar>
        }
        title={employee.Name}
        subheader={employee.JobTitle}
      />
      <CardMedia
        component="img"
        variant="circular"
        image={employee["Avatar"]["url"]}
        alt="employee image"
      />
      <CardContent>
        <Typography variant="body2" color="text.secondary">
          {employee.Email}
        </Typography>
      </CardContent>
    </Card>
  );
}

export default Employee;
